import React from "react";
import { connect } from "react-redux";
import { Actions as authActions } from "../../redux/auth";
import { useNavigate } from "react-router-dom";
import { EuiLink, EuiButton, EuiPageBody, EuiPageContent, EuiPageContentBody } from "@elastic/eui";

function Logout({ logUserOut }) {
  const handleLogout = () => {
    logUserOut();
    navigate("/");
  };

  const navigate = useNavigate();

  return (
    <EuiPageBody component="section">
      <EuiPageContent verticalPosition="center" horizontalPosition="center">
        {/* <EuiPageContentBody> */}
          <EuiButton>
            <EuiLink onClick={() => handleLogout()}>Sair</EuiLink>
          </EuiButton>
        {/* </EuiPageContentBody> */}
      </EuiPageContent>
    </EuiPageBody>
  );
}

export default connect((state) => ({ user: state.auth.user }), {
  logUserOut: authActions.logUserOut,
})(Logout);
